import Header from "../components/header/Header";
import { Space, Table, Tag } from "antd";

export const CartPage = () => {
  const dataSource = [
    {
      key: "1",
      name: "Elma",
      age: 3,
      address: "10 Downing Street",
    },
    {
      key: "2",
      name: "Karpuz",
      age: 42,
      address: "10 Downing Street",
    },
  ];
  const columns = [
    {
      title: "Ürün Adı",
      dataIndex: "name",
      key: "name",
    },
    {
      title: "Adet",
      dataIndex: "age",
      key: "age",
    },
    {
      title: "Fiyat",
      dataIndex: "address",
      key: "address",
    },
  ];
  return (
    <div>
      <Header />
      <div className="px-6">
        <Table dataSource={dataSource} columns={columns} bordered/>
      </div>
    </div>
  );
};
